import React from "react";
import { Container, Typography, Box, Avatar, Paper } from "@mui/material";

export default function LeftPane() {
  return (
    <Container
      maxWidth="sm"
      xs={{ marginTop: "2rem" }}
      style={{ backgroundColor: "white" }}
    >
      <ul>
        <li>
          <Typography variant="body1" textAlign={"left"}>
            About Me
          </Typography>
        </li>
        <li>
          <Typography variant="body1" textAlign={"left"}>
            My Projects
          </Typography>
        </li>
        <li>
          <Typography variant="body1" textAlign={"left"}>
            Contact me
          </Typography>
        </li>
      </ul>
    </Container>
  );
}
